zen Satisfaction survey. To see the most recent reports, visit <a href=\\\"https://calgary.ca/citizensatisfaction\\\">Calgary.ca/citizensatisfaction</a>.\\n\\nFor detailed information on the variables in this dataset, <a href=\\\"https://data.calgary.ca/api/views/btc8-9kef/files/8edca0d5-637f-4333-aaf1-f00a61a1fc11?download=true&filename=Variable-metadata%202018-2021.xlsx\\\">see the variable metadata</a>.\\n\\nMethodology\\nThe Citizen Satisfaction survey is a telephone survey conducted with a randomly selected sample of Calgarians aged 18 years and older. The survey is conducted on an annual basis.\\nThe data are weighted to ensure the overall sample’s quadrant, ward, and age/gender composition reflects that of the actual Calgary population aged 18 or older according to Municipal and Federal Census data. Weights are included in the dataset.\\n\\n<a href=\\\"https://data.calgary.ca/api/views/btc8-9kef/files/8edca0d5-637f-4333-aaf1-f00a61a1fc11?download=true&filename=Variable-metadata%202018-2021.xlsx\\\">The variable metadata</a> contains detailed information on the variables.\",\n            \"attribution\" : \"The City of Calgary\",\n            \"attribution_link\" : \"https://calgary.ca/citizensatisfaction\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2023-02-01T15:39:18.000Z\",\n            \"createdAt\" : \"2021-06-10T19:07:06.000Z\",\n            \"metadata_updated_at\" : \"2023-02-01T15:39:18.000Z\",\n            \"data_updated_at\" : \"2022-05-31T20:31:33.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 5,\n                \"page_views_last_month\" : 26,\n                \"page_views_total\" : 2429,\n                \"page_views_last_week_log\" : 2.584962500721156,\n                \"page_views_last_month_log\" : 4.754887502163469,\n                \"page_views_total_log\" : 11.246740598493144\n              },\n            \"columns_name\" :\n