tive\",\n            \"display_name\" : \"Raleigh McCoy\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"wg3i-tdm6\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Raleigh McCoy\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Quarterly Census of Employment and Wages Quarterly Data: Beginning 2000\",\n            \"id\" : \"cwsm-2ns3\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"The Quarterly Census of Employment and Wages (QCEW) program (also known as ES-202) collects employment and wage data from employers covered by New York State's Unemployment Insurance (UI) Law. This program is a cooperative program with the U.S. Bureau of Labor Statistics. QCEW data encompass approximately 97 percent of New York's nonfarm employment, providing a virtual census of employees and their wages as well as the most complete universe of employment and wage data, by industry, at the State, regional and county levels. \\\"Covered\\\" employment refers broadly to both private-sector employees as well as state, county, and municipal government employees insured under the New York State Unemployment Insurance (UI) Act. Federal employees are insured under separate laws, but are considered covered for the purposes of the program. Employee categories not covered by UI include some agricultural workers, railroad workers, private household workers, student workers, the self-employed, and unpaid family workers. QCEW data are similar to monthly Current Employment Statistics (CES) data in that they reflect jobs by place of work; therefore, if a person holds two jobs, he or she is counted twice. However, since the QCEW program, by definition, only measures employment covered by unemployment insurance laws, its totals will not be the same as CES employment totals due to the employee categories excluded by UI.\",\n            \"at