ason for case denial, for each Local Social Services District (SSD).  It is similar to data published on an annual basis in the \\\"Statistical Report on the Operations of New York State Public Assistance Programs.\\\"\",\n            \"attribution\" : \"New York State Office of Temporary and Disability Assistance (OTDA)\",\n            \"attribution_link\" : \"https://otda.ny.gov/resources/legislative-report/\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-07-09T13:01:41.000Z\",\n            \"createdAt\" : \"2016-05-10T16:50:36.000Z\",\n            \"metadata_updated_at\" : \"2025-07-09T13:01:40.000Z\",\n            \"data_updated_at\" : \"2025-07-09T13:01:41.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 12,\n                \"page_views_last_month\" : 57,\n                \"page_views_total\" : 4360,\n                \"page_views_last_week_log\" : 3.700439718141092,\n                \"page_views_last_month_log\" : 5.857980995127572,\n                \"page_views_total_log\" : 12.090443275081606\n              },\n            \"columns_name\" :\n              [\n                \"SNA Case Denials - Financial Issues\",\n                \"Month\",\n                \"District Code\",\n                \"District\",\n                \"Total PA Case Denials - Financial Issues\",\n                \"Year\",\n                \"Total Public Assistance (PA) Case Denials - Client Request\",\n                \"Month Code\",\n                \"Total PA Case Denials - Compliance Issues / Employment\",\n                \"Total PA Case Denials - Compliance Issues / Other\",\n                \"FA Denials Case - Financial Issues\",\n                \"SNA Case Denials - Other\",\n                \"SNA Case Denials - Compliance Issues / Other\",\n                \"SNA Case Denials - Residence Issues\",\n                \"Safety Net Assistance (SNA) Case Denials - Client Request\",\n                \"FA Case Denials - Other\",\n                \"FA Case Denials - Compliance Issues / Employment\",\n                \"Family Assistance (FA) Case Denials - Client Request\",\n                \"Total PA Case Denials - Other\",\n                \"Total PA Case Denials - Residence Issues\",\n                \"FA Case Denials - Residence Issues\",\n                \"FA Case Denials - Compliance Issues / Other\",\n                \"SNA Case Denials - Compliance Issues / Employment\"\n              ],\n            \"columns_field_name\" :\n              [\n                \"sna_finance\",\n                \"month\",\n                \"district_code\",\n                \"district\",\n                \"ta_finance\",\n                \"year\",\n                \"ta_client_req\",\n                \"month_code\",\n                \"ta_comp_employ\",\n                \"ta_comp_other\",\n                \"fa_finance\",\n                \"sna_other\",\n                \"sna_comp_other\",\n                \"sna_residence\",\n                \"sna_client_req\",\n                \"fa_other\",\n                \"fa_comp_employ\",\n                \"fa_client_req\",\n                \"ta_other\",\n                \"ta_residence\",\n                \"fa_residence\",\n                \"fa_comp_other\",\n                \"sna_comp_employ\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\"\n              ],\n            \"columns_description\" :\n              [\n                \"Safety Net Assistance case denials due to financial issues; these include increased earned or unearned income, exceeding resource limits, or other household circumstance changes that make the case financially ineligible.\",\n                \"Month data pertains to. Denials are reported on a monthly basis. Day is always the first day of the reference month. The first available month is January 2006.\",\n                \"Contains a code ranging from 01 to 57 and 66,\\ndesignating each of the State’s Local Social\\nServices Districts, which are New York City and\\nthe remaining 57 counties. For the non-New\\nYork City counties, the code refers to the\\nalphabetical order of the district name (e.g.,\\nAlbany=01, Yates = 57). For New York City, the\\ncode is 66.\",\n                \"Text name of each social services district.\",\n                \"Total Public Assistance case denials due to financial issues; these include increased earned or unearned income, exceeding resource limits, or other household circumstance changes that make the case financially ineligible. Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Year data pertains to\",\n                \"Total Public Assistance case denials at the request of the client. Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Number corresponding to month. January = 1, December = 12, etc.\",\n                \"Total Public Assistance case denials due to compliance issues related to employment; these include failure to participate as required in Public Assistance  work participation requirements, such as failure to cooperate with establishing employability, failure to attend work program assignments and voluntarily leaving or failing to accept employment without good cause. Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Total Public Assistance case denials due to compliance issues other than employment; these include failure to comply with rules other than those related to employment, such as failure to show for eligibility interviews, provide required documentation to verify eligibility or comply with household composition requirements.  Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Family Assistance case denials due to financial issues; these include increased earned or unearned income, exceeding resource limits, or other household circumstance changes that make the case financially ineligible.\",\n                \"Safety Net Assistance case denials due to issues not included in the previous categories.\",\n                \"Safety Net Assistance case denials due to compliance issues other than employment; these include failure to comply with rules other than those related to employment, such as failure to show for eligibility interviews, provide required documentation to verify eligibility or comply with household composition requirements.\",\n                \"Safety Net Assistance case denials due to residence issues; these include cases not residing in the jurisdiction of application or where the client cannot be located.\",\n                \"Safety Net Assistance case denials at the request of the client.\",\n                \"Family Assistance case denials due to issues not included in the previous categories.\",\n                \"Family Assistance case denials due to compliance issues related to employment; these include failure to participate as required in Public Assistance  work participation requirements, such as failure to cooperate with establishing employability, failure to attend work program assignments and voluntarily leaving or failing to accept employment without good cause.\",\n                \"Family Assistance case denials at the request of the client.\",\n                \"Total Public Assistance case denials due to issues not included in the previous categories. Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Total Public Assistance case denials due to residence issues; these include cases not residing in the jurisdiction of application or where the client cannot be located.  Sum of Family Assistance and Safety Net Assistance case denials.\",\n                \"Family Assistance case denials due to residence issues; these include cases not residing in the jurisdiction of application or where the client cannot be located.\",\n                \"Family Assistance case denials due to compliance issues other than employment; these include failure to comply with rules other than those related to employment, such as failure to show for eligibility interviews, provide required documentation to verify eligibility or comply with household composition requirements.\",\n                \"Safety Net Assistance case denials due to compliance issues related to employment; these include failure to participate as required in Public Assistance  work participation requirements, such as failure to cooperate with establishing employability, failure to attend work program assignments and voluntarily leaving or failing to accept employment without good cause.\"\n              ],\n            \"columns_format\" :\n              [\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"center\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n              