ts the current grouping system, data here may not exactly match data in other published sources.\"\n                }\n              ]\n          },\n        \"metadata\" : { \"domain\" : \"data.ny.gov\" },\n        \"permalink\" : \"https://data.ny.gov/d/tyyj-jgv5\",\n        \"link\" : \"https://data.ny.gov/Human-Services/Public-Assistance-Case-Denials-by-Reason-for-Denia/tyyj-jgv5\",\n        \"owner\" :\n          {\n            \"id\" : \"xzik-pf59\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"NY Open Data\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"xzik-pf59\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"NY Open Data\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Weigh-In-Motion Station Vehicle Traffic Counts: 2013\",\n            \"id\" : \"7y2e-49j8\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"This data set is a list of daily vehicle counts, in each direction, taken at the weigh-in-motion (WIM) stations operated by the New York State Department of Transportation (NYSDOT) during the 2013 calendar year.  Daily totals by direction are provided, as well as totals in each of 13 vehicle-type classes, and latitude-longitude locations of each station.\",\n            \"attribution\" : \"New York State Department of Transportation (DOT)\",\n            \"attribution_link\" : \"https://www.dot.ny.gov/divisions/engineering/technical-services/highway-data-services\",\n            \"contact_email\" : \"opendata@its.ny.gov\",\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2019-06-13T19:39:47.000Z\",\n            \"createdAt\" : \"2015-01-21T19:27:54.000Z\",\n            \"metadata_updated_at\" : \"2019-06-13T19:39:47.000Z\",\n            \"data_updated_at\" : \"2015-02-04T12:29:20.000Z\",\n            \"page_views\" :\n              {\n