ion_yamh_8v7k\",\n                \":@computed_region_wbg7_3whc\",\n                \"location_1_city\",\n                \"location_1_state\",\n                \"location_1_zip\",\n                \"count_date\",\n                \"class1\",\n                \"class3\",\n                \"class5\",\n                \"class8\",\n                \"class9\",\n                \"class13\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Number\",\n                \"Point\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Calendar date\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\"\n              ],\n            \"columns_description\" :\n              [\n                \"The total number of multi-trailer, six-axle trucks detected at the station, on the given day, in the given direction.\",\n                \"\",\n                \"The longitude of the station, in degrees west of the Prime Meridian.\",\n                \"The latitude of the station, in degrees north of the equator.\",\n                \"The total number of multi-trailer, four- or five-axle trucks detected at the station, on the given day, in the given direction.\",\n                \"The total number of single-trailer, six-or-more-axle trucks detected at the station, on the given day, in the given direction.\",\n                \"The total number of single-unit, four-or-more-axle trucks detected at the station, on the given day, in the given direction. These vehicles do not have trailers.\",\n                \"The total number of single-unit, three-axle trucks detected at the station, on the given day, in the given direction. These vehicles do not have trailers.\",\n                \"The total number of buses detected at the station, on the given day, in the given direction. Buses may have two or three axles.\",\n                \"The total number of passenger vehicles detected at the station, on the given day, in the given direction. Passenger vehicles always have two axles, and may pull a one- or two-axle trailer.\",\n                \"The principal direction of traffic on the route (for example, north on a north-south road, east on an east-west road).\",\n                \"The number of months included in the count based on the total number of weekdays the data was collected. Generally, only months with at least ten weekdays or two weeks of data are included.\",\n                \"Route name or number where the station is located\",\n                \"DOT station number of the weigh in motion site\",\n                \"The total number of lanes in both directions\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"The date the data was collected. Only weekdays (Mon-Fri) were used, and any date where the station failed to collect valid data (due to malfunctions, maintenance, etc.) was discarded.\",\n                \"The total number of motorcycles detected at the station, on the given day, in the given direction. Motorcycles include all two- and three-wheeled vehicles.\",\n                \"The total number of pickups, panels, and vans detected at the station, on the given day, in the given direction. These vehicles are larger than passenger vehicles, always have two axles, and may pull a one- or two-axle trailer.\",\n                \"The total number of single-unit, two-axle trucks detected at the station, on the given day, in the given direction. These vehicles typically have dual-rear wheels. These vehicles do not have trailers.\",\n                \"The total number of single-trailer, three- or four-axle trucks detected at the station, on the given day, in the given direction.\",\n                \"The total number of single-trailer, five-axle trucks detected at the station, on the given day, in the given direction. These trucks (“18 wheelers”) are those most commonly used for long-distance road transport, and therefore are the main focus of NYSDOT’s weigh in motion program.\",\n                \"The total number of multi-trailer, seven-or-more-axle trucks detected at the station, on the given day, in the given direction.\"\n              ],\n            \"columns_format\" :\n              [\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                { \"view\" : \"address_coords\", \"align\" : \"right\" },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"right\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"right\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"false\",\n                  \"align\" : \"center\"\n                },\n                {\n                  \"precisionS