        {\n                  \"key\" : \"Additional-Resources_See-Also-\",\n                  \"value\" : \"http://www.fhwa.dot.gov/policyinformation/tmguide/\"\n                },\n                {\n                  \"key\" : \"Dataset-Summary_Contact-Information\",\n                  \"value\" : \"Anthony.Torre@dot.ny.gov\"\n                },\n                {\n                  \"key\" : \"Dataset-Summary_Granularity\",\n                  \"value\" : \"Weigh-in-motion station\"\n                },\n                { \"key\" : \"Dataset-Summary_Coverage\", \"value\" : \"Statewide\" },\n                {\n                  \"key\" : \"Dataset-Summary_Posting-Frequency\",\n                  \"value\" : \"Static - Not Updated\"\n                },\n                {\n                  \"key\" : \"Dataset-Summary_Organization\",\n                  \"value\" : \"NYS DOT, Highway Data Service Bureau, Main Office\"\n                },\n                {\n                  \"key\" : \"Dataset-Summary_Time-Period\",\n                  \"value\" : \"2013 calendar year\"\n                },\n                {\n                  \"key\" : \"Dataset-Information_Agency\",\n                  \"value\" : \"Transportation, Department of\"\n                },\n                {\n                  \"key\" : \"Disclaimers_Limitations\",\n                  \"value\" : \"Data were collected on business days (Monday through Friday) only and was not collected on Saturdays or Sundays.\"\n                }\n              ]\n          },\n        \"metadata\" : { \"domain\" : \"data.ny.gov\" },\n        \"permalink\" : \"https://data.ny.gov/d/7y2e-49j8\",\n        \"link\" : \"https://data.ny.gov/Transportation/Weigh-In-Motion-Station-Vehicle-Traffic-Counts-201/7y2e-49j8\",\n        \"owner\" :\n          {\n            \"id\" : \"xzik-pf59\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"NY Open Data\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"xzik-pf59\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"NY Open Data\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"Uninsured Population Census Data CY 2009-2014 Human Services\",\n            \"id\" : \"s782-mpqp\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"This data is pulled from the U.S. Census website. This data is for years Calendar Years 2009-2014.\\r\\nProduct: SAHIE File Layout Overview\\r\\nSmall Area Health Insurance Estimates Program - SAHIE \\r\\nFilenames: SAHIE Text and SAHIE CSV files 2009 – 2014\\r\\nSource: Small Area Health Insurance Estimates Program, U.S. Census Bureau.\\r\\nInternet Release Date: May 2016\\r\\nDescription: Model‐based Small Area Health Insurance Estimates (SAHIE) for Counties and States File Layout and Definitions\\r\\n\\r\\nThe Small Area Health Insurance Estimates (SAHIE) program was created to develop model-based estimates of health insurance coverage for counties and states. This program builds on the work of the Small Area Income and Poverty Estimates (SAIPE) program. SAHIE is only source of single-year health insurance coverage estimates for all U.S. counties.\\r\\n\\r\\nFor 2008-2014, SAHIE publishes STATE and COUNTY estimates of population with and without health insurance coverage, along with measures of uncertainty, for the full cross-classification of:\\r\\n•5 age categories: 0-64, 18-64, 21-64, 40-64, and 50-64\\r\\n\\r\\n•3 sex categories: both sexes, male, and female\\r\\n\\r\\n•6 income categories: all incomes, as well as income-to-poverty ratio (IPR) categories 0-138%, 0-200%, 0-250%, 0-400%, and 138-400% of the poverty threshold\\r\\n\\r\\n•4 races/ethnicities (for states only): all races/ethnicities, White not Hispanic, Black not Hispanic, and Hispanic (any race).\\r\\n\\r\\nIn addition, estimates for age category 0-18 by the income categories listed above are published.\\r\\n\\r\\nEach year’s estimates are adjusted so that, before rounding, the county estimates sum to their respective state totals and for key demographics the state estimates sum to the national ACS numbers insured and uninsured.\\r\\n\\r\\n\\r\\nThis program is partially funded by the Centers for Disease Control and Prevention's (CDC), National Breast and Cervical Cancer Early Detection ProgramLink to a non-federal Web site (NBCCEDP). The CDC have a congressional mandate to provide screening services for breast and cervical cancer to low-income, uninsured, and underserved women through the NBCCEDP. Most state NBCCEDP programs define low-income as 200 or 250 percent of the poverty threshold. Also included are IPR categories relevant to the Affordable Care Act (ACA). In 2014, the ACA will help families gain access to health care by allowing Medicaid to cover families with incomes less than or equal to 138 percent of the poverty line. Families with incomes above the level needed to qualify for Medicaid, but less than or equal to 400 percent of the poverty line can receive tax credits that will help them pay for health coverage in the new health insurance exchanges. \\r\\n\\r\\nWe welcome your feedback as we continue to research and improve our estimation methods. The SAHIE program's age model methodology and estimates have undergone internal U.S. Census Bureau review as well as external review. See the SAHIE Methodological Review page for more details and a summary of the comments and our response. \\r\\n\\r\\nThe SAHIE program models health insurance coverage by combining survey data from several sources, including:\\r\\n•The American Community Survey (ACS)\\r\\n•Demographic population estimates\\r\\n•Aggregated federal tax returns\\r\\n•Participation records for the Supplemental Nutrition Assistance Program (SNAP), formerly known as the Food Stamp program\\r\\n•County Business Patterns\\r\\n•Medicaid\\r\\n•Children's Health Insurance Program (CHIP) participation records\\r\\n•Census 2010\\r\\n\\r\\nMargin of error (MOE). Some ACS products provide\\r\\nan MOE instead of confidence intervals. An MOE is the\\r\\ndifference between an estimate and its upper or lower\\r\\nconfidence bounds. Confidence bounds can be created\\r\\nby adding the margin of error to the estimate (for the\\r\\nupper bound) and subtracting the margin of error from\\r\\nthe estimate (for the lower bound). All published ACS\\r\\nmargins of error are based on a 90-percent confidence\\r\\nlevel.\",\n            \"attribution\" : \"Small Area Health Insurance Estimates Program, U.S. Census Bureau\",\n            \"attribution_link\" : \"https://www.census.gov/programs-surveys/sahie.html\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2022-10-18T14:19:11.000Z\",\n            \"createdAt\" : \"2016-08-18T16:16:29.000Z\",\n            \"metadata_updated_at\" : \"2022-10-18T14:19:11.000Z\",\n            \"data_updated_at\" : \"2018-07-25T17:50:28.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 5,\n                \"page_views_last_month\" : 38,\n                \"page_views_total\" : 4245,\n                \"page_views_last_week_log\" : 2.584962500721156,\n                \"page_views_last_month_log\" : 5.285402218862249,\n                \"page_views_total_log\" : 12.051888655905378\n              },\n            \"columns_name\" :\n              [\n                \"Race - One Race - Native Hawaiian and Other Pacific Islander - Uninsured\",\n                \"Race - One Race - Native Hawaiian and Other Pacific Islander - Uninsured MOE\",\n                \"Race - One Race - Native Hawaiian and Other Pacific Islander - Uninsured Pct\",\n                \"Race - One Race - Asian - Uninsured Pct MOE\",\n                \"Race - One Race - Asian - Uninsured Pct\",\n                \"Race - One Race - Asian - Uninsured MOE\