e, if a respondent identifies as \\\"Asian\\\" and \\\"White,\\\" they may respond to the question on race by checking the appropriate boxes that describe their racial identities and/or writing in these identities on the spaces provided. What is Race? The data on race were derived from answers to the question on race that was asked of individuals in the United States. The Census Bureau collects racial data in accordance with guidelines provided by the U.S. Office of Management and Budget (OMB), and these data are based on self-identification. The racial categories included in the census questionnaire generally reflect a social definition of race recognized in this country and not an attempt to define race biologically, anthropologically, or genetically. In addition, it is recognized that the categories of the race item include racial and national origin or sociocultural groups. People may choose to report more than one race to indicate their racial mixture, such as “American Indian” and “White.” People who identify their origin as Hispanic, Latino, or Spanish may be of any race. OMB requires five minimum categories: White, Black or African American, American Indian or Alaska Native, Asian, and Native Hawaiian or Other Pacific Islander. Reasons for collecting information on race Information on race is required for many Federal programs and is critical in making policy decisions, particularly for civil rights. States use these data to meet legislative redistricting principles. Race data also are used to promote equal employment opportunities and to assess racial disparities in health and environmental risks. Contact Us For assistance, please contact the Census Call Center at 1-800-923-8282 (toll free) or visit ask.census.gov for further information. More info on race - https://www.census.gov/topics/population/race/about/faq.html\",\n                \"Count of uninsured individuals who selected Native Hawaiian and Other Pacific Islander as their race - Margin of Error 