e as of the day of the census. The income data collected in the 1990, 1980, 1970 censuses are similar to Census 2000 data, but details of the questions varied. (1970) income data were collected and presented for the population 14 and older. \",\n                \"Margin of Error - Income of the householder and all other individuals in the household, whether they are related to the householder or not. although the household income statistics cover the calendar year preceding the census, the characteristics of the individuals and the composition of the households are as of the day of the census. (2000, 1990, 1980). The incomes of the household members 15 and older were included. (1970) The incomes of the household members 14 and older were included. Income - (2000) The sum of the amonts reported by repsondents 15 and older for wages, salary, commissions, bonuses, or tips: self-employment incomes from own nonfarm or farm businesses: Interest, dividends, net rental, income, royalty incomes, or income from estates and trust: social security or railroad retirement incomes: Supplemental Security Income: any public assistance or welfare payments: retirement, survivor, or disability pension: and any other sources of income received regularly, such as veterans; payments, unemployment compensation, child support, or alimony. Although the income statistics cover the calendar year preceding the census, the characteristics of individuals are as of the day of the census. The income data collected in the 1990, 1980, 1970 censuses are similar to Census 2000 data, but details of the questions varied. (1970) income data were collected and presented for the population 14 and older. \",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n     