nd county equivalents in the United States, certain U.S. possessions, and certain freely associated states. This is the 3-digit part of the 5-digit county FIPS code specifically standing for the county.\",\n                \"These are the first 2 digits of the 5-digit Federal Information Processing Standard (FIPS) code that designate the State association. Each State has its own 2-digit number and each County within the state has its own 3-digit number which are combined into a 5-digit number to uniquely identify every US county. For more technical details : Federal Information Processing Standards Publications (FIPS PUBS) are issued by the National Institute of Standards and Technology (NIST) after approval by the Secretary of Commerce pursuant to Section 111 (d) of the Federal Property and Administrative Services Act of 1949 as amended by the Computer Security Act of 1987, Public Law 100-235. Federal Information Processing Standard (FIPS) 6-4, Counties and Equivalent Entities of the U.S., Its Possessions, and Associated Areas -- 90 Aug 31 , provides the names and codes that represent the counties and other entities treated as equivalent legal and/or statistical subdivisions of the 50 States, the District of Columbia, and the possessions and freely associated areas of the United States. Counties are considered to be the \\\"first-order subdivisions\\\" of each State and statistically equivalent entity, regardless of their local designations (county, parish, borough, etc.). Information gathered from census data -https://www.census.gov/library/reference/code-lists/ansi.html\",\n                \"Using the numbers 1-67 representing Pennsylvania counties and showing the leading zeroes in this text fields to match in other files and make coding easier. \",\n                \"County within the State of Pennsylvania. \\nThere are 67 counties.\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n                \"\",\n            